import{_get as e}from"../_modules/get/get.min.js";let errElement=document.getElementById("errorTxt");function emojiValue(e){return"true"==e?"✅":"❌"}function toIcons(e){return e.replaceAll("0","⬜").replaceAll("1","\uD83D\uDFEA").replaceAll("2","\uD83D\uDFE8").replaceAll("3","❷").replaceAll("4","❷")}function fullGridString(e,r){let a=e.match(/.{1,9}/g);var t=[];return t.push(toIcons(a[0])),t.push(toIcons(a[1])),t.push(toIcons(a[2])),t.join(r)}async function loadData(){let r=new URLSearchParams(window.location.search),a=r.get("id");errElement.innerText="deleting...",e(`/api/data/detail/id/${a}`,errElement.id).then(e=>{var r=`<b>Author:</b> ${e.name} (from team ${e.fromTeam})<br><br><b>AUTO: <br>Taxi: </b>${emojiValue(e.game1)}<br><b>Score B/M/T: </b>${emojiValue(e.game2)}${emojiValue(e.game3)}${emojiValue(e.game4)}<br><b>Charging: </b>${e.game5} pts<br><br><b>TELEOP: <br>Score B/M/T: </b>${emojiValue(e.game6)}${emojiValue(e.game7)}${emojiValue(e.game8)}<br><b>Charging: </b>${e.game10} pts<br><br><b>Other: <br>Alliance COOPERTITION: </b>${emojiValue(e.game9)}<br><b>Cycle Time: </b>${e.game11} seconds<br><b>Defense: </b>${e.defend}<br><b>Driving: </b>${e.driving}<br><b>Overall: </b>${e.overall}<br><b>Grid:<br>${fullGridString(e.game12.toString(),"<br>")}<br><br><b>low/mid/high cubes - cones: </b>${e.game21}/${e.game14}/${e.game16} - ${e.game13}/${e.game15}/${e.game17}<br><b>low/mid/high pcs: </b>${e.game18}/${e.game19}/${e.game20}<br><b>cubes/cones: </b>${e.game23}/${e.game24}<br><b>total grid: </b>${e.game25}pts<br><b>Match Performance Score: </b>${Number(e.weight.split(",")[0]).toFixed(2)}`;document.getElementById("resultTeamNum").innerText=e.team,document.getElementById("resultMatchNum").innerText=e.match,document.getElementById("resultEventCode").innerText=e.event,document.getElementById("resultText").innerHTML=r}).catch(e=>console.log(e))}window.loadData=loadData;